/*Table structure for table `area_shipping` */

DROP TABLE IF EXISTS `area_shipping`;

CREATE TABLE `area_shipping` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` char(20) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `modify_date` datetime DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `creator` varchar(25) DEFAULT NULL,
  `modifier` varchar(25) DEFAULT NULL,
  `del_flag` bit(1) DEFAULT NULL,
  `area_uuid` char(20) DEFAULT NULL COMMENT '地区ID',
  `shipping_uuid` char(20) DEFAULT NULL COMMENT '配送方式uuid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5661 DEFAULT CHARSET=utf8mb4 COMMENT='地区与物流关联表';

/*Data for the table `area_shipping` */

/*Table structure for table `base_colour_info` */

DROP TABLE IF EXISTS `base_colour_info`;

CREATE TABLE `base_colour_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `code` varchar(200) NOT NULL COMMENT '颜色编码',
  `name` varchar(250) NOT NULL COMMENT '颜色名称',
  `barcode` varchar(200) DEFAULT NULL COMMENT '条码编码',
  `image_src` varchar(500) DEFAULT NULL COMMENT '颜色图片',
  `sorid` int(11) DEFAULT NULL COMMENT '排序id',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `creater` varchar(150) DEFAULT NULL COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `updater` varchar(150) DEFAULT NULL COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `status` varchar(1) DEFAULT NULL COMMENT '0删除',
  `rgb` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `u_code` (`code`) USING BTREE,
  UNIQUE KEY `u_rgb` (`rgb`)
