/*Table structure for table `base_data` */

DROP TABLE IF EXISTS `base_data`;

CREATE TABLE `base_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `version` int(11) DEFAULT NULL COMMENT '版本',
  `orders` int(11) DEFAULT NULL COMMENT '排序',
  `grade` int(11) DEFAULT '0' COMMENT '等级',
  `uuid` char(20) DEFAULT NULL COMMENT '业务主键',
  `parent_id` char(20) DEFAULT '0' COMMENT '父类主键',
  `class_name` varchar(25) DEFAULT NULL COMMENT '类别名称',
  `type` int(1) DEFAULT NULL COMMENT '类型 0:工作 1:发型 2:肤色 3:爱好 5换货原因 6:温度 7:场合 8:色系 9:风格 10:潮搭的分类',
  `status` bit(1) DEFAULT NULL COMMENT '状态 0：隐藏 1：显示',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `creator` varchar(255) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(255) DEFAULT NULL COMMENT '修改人',
  `del_flag` bit(1) DEFAULT NULL COMMENT '删除标示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=135 DEFAULT CHARSET=utf8;

/*Data for the table `base_data` */

/*Table structure for table `base_style` */

DROP TABLE IF EXISTS `base_style`;

CREATE TABLE `base_style` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uuid` char(20) NOT NULL COMMENT '业务主键 ',
  `creator` varchar(25) DEFAULT NULL,
  `modifier` varchar(25) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `modify_date` datetime DEFAULT NULL,
  `del_flag` bit(1) DEFAULT b'0',
  `version` int(11) DEFAULT NULL,
  `status` int(11) DEFAULT '1' COMMENT '1:正常',
  `style_sn` varchar(25) DEFAULT NULL,
  `style_name` varchar(25) DEFAULT NULL,
  `style_pic` varchar(225) DEFAULT NULL,
  `season` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `Index_uuid` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='服装款式表';

/*Data for the table `base_style` */

/*Table structure for table `class_category` */

DROP TABLE IF EXISTS `class_category`;

CREATE TABLE `class_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` datetime DEFAULT NULL COMMENT '创建日期',
  `modify_date` datetime DEFAULT NULL COMMENT '修改日期',
  `version` int(11) DEFAULT NULL COMMENT '版本',
  `orders` int(11) DEFAULT NULL COMMENT '顺序编号',
  `grade` int(11) DEFAULT NULL COMMENT '层级编号',
  `uuid` char(20) DEFAULT NULL COMMENT '业务主键',
  `parent_id` char(20) DEFAULT NULL COMMENT '父节点主键',
  `class_name` varchar(25) DEFAULT NULL COMMENT '分类名称',
  `tree_path` varchar(255) DEFAULT NULL COMMENT '在树中的全路径',
  `status` bit(1) DEFAULT NULL COMMENT '状态：0：隐藏，1：显示',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `creator` varchar(25) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(25) DEFAULT NULL COMMENT '修改人',
  `del_flag` bit(1) DEFAULT NULL COMMENT '删除标志：1：删除，0：正常',
  `goods_num` int(11) DEFAULT NULL,
  `code` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Index_uuid` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=214 DEFAULT CHARSET=utf8 COMMENT='品类分类';

/*Data for the table `class_category` */

/*Table structure for table `coat_category` */

DROP TABLE IF EXISTS `coat_category`;

CREATE TABLE `coat_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `version` int(11) DEFAULT NULL COMMENT '版本',
  `orders` int(11) DEFAULT '0' COMMENT '排序',
  `grade` int(11) DEFAULT '0' COMMENT '等级',
  `uuid` char(20) DEFAULT NULL COMMENT '业务主键',
  `parent_id` char(20) DEFAULT '0' COMMENT '父类主键',
  `class_name` varchar(25) DEFAULT NULL COMMENT '类别名称',
  `type` int(1) DEFAULT NULL COMMENT '类型 0:衣服版型数据；1：袖长数据；2：袖型数据，3：领型数据；4：衣门禁数据',
  `status` bit(1) DEFAULT NULL COMMENT '状态 0：隐藏 1：显示',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `creator` varchar(255) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(255) DEFAULT NULL COMMENT '修改人',
  `del_flag` bit(1) DEFAULT NULL COMMENT '删除标示',
  `goods_num` int(11) DEFAULT NULL COMMENT '商品数量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8 COMMENT='上衣分类表';

/*Data for the table `coat_category` */

/*Table structure for table `collocation` */

DROP TABLE IF EXISTS `collocation`;

CREATE TABLE `collocation` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `version` int(11) DEFAULT NULL COMMENT '版本',
  `creator` varchar(255) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(255) DEFAULT NULL COMMENT '修改人',
  `uuid` char(20) DEFAULT NULL COMMENT '业务主键',
  `del_flag` bit(1) DEFAULT NULL COMMENT '删除标示',
  `temperature_uuid` char(20) DEFAULT NULL COMMENT '温度',
  `occasion_uuid` char(20) DEFAULT NULL COMMENT '场合',
  `colour_uuid` char(20) DEFAULT NULL COMMENT '色系',
  `style_uuid` char(20) DEFAULT NULL COMMENT '风格',
  `index_image` varchar(255) DEFAULT NULL COMMENT '图片',
  `goodslist` varchar(255) DEFAULT NULL COMMENT '商品的集合(商品名称，业务主键，封面图)',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COMMENT='搭配潮搭';

/*Data for the table `collocation` */

/*Table structure for table `delivery_corp` */

