/*Table structure for table `resource_dyeing_pattern` */

DROP TABLE IF EXISTS `resource_dyeing_pattern`;

CREATE TABLE `resource_dyeing_pattern` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `code` varchar(50) DEFAULT NULL COMMENT '花样编码',
  `name` varchar(25) DEFAULT NULL COMMENT '花样名称',
  `image_url` varchar(150) DEFAULT NULL COMMENT '花样效果图',
  `image_length` int(4) DEFAULT NULL COMMENT '效果图长(mm)',
  `image_width` int(4) DEFAULT NULL COMMENT '效果图宽(mm)',
  `product_file` varchar(150) DEFAULT NULL COMMENT '生产文件',
  `type` char(20) DEFAULT NULL COMMENT '花样分类UUID',
  `price` decimal(21,6) DEFAULT NULL COMMENT '价格',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注说明',
  `status` int(4) DEFAULT '1' COMMENT '状态0:禁用 1:启用',
  `del_flag` bit(1) NOT NULL COMMENT '删除标识',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `modify_date` datetime NOT NULL COMMENT '修改时间',
  `creator` varchar(25) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(25) DEFAULT NULL COMMENT '最后修改人',
  `uuid` char(20) NOT NULL,
  `version` int(11) NOT NULL COMMENT '版本',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_index` (`uuid`),
  UNIQUE KEY `unique_code` (`code`),
  UNIQUE KEY `unique_name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8 COMMENT='特殊工艺表';

