/*Table structure for table `resource_line` */

DROP TABLE IF EXISTS `resource_line`;

CREATE TABLE `resource_line` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `modify_date` datetime NOT NULL COMMENT '修改时间',
  `creator` varchar(25) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(25) DEFAULT NULL COMMENT '最后修改人',
  `uuid` char(20) NOT NULL COMMENT '业务主键',
  `version` int(11) NOT NULL COMMENT '版本',
  `code` varchar(50) DEFAULT NULL COMMENT '缝纫线编码',
  `name` varchar(25) DEFAULT NULL COMMENT '缝纫线名称',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注说明',
  `supplier` varchar(50) DEFAULT NULL COMMENT '采样供应商',
  `linkman` varchar(25) DEFAULT NULL COMMENT '联系人',
  `linktel` char(13) DEFAULT NULL COMMENT '联系电话',
  `linkphone` char(11) DEFAULT NULL COMMENT '联系手机',
  `status` int(1) DEFAULT '0' COMMENT '状态(0:禁用，1:启用)',
  `del_flag` bit(1) NOT NULL COMMENT '删除标志',
  `source_uuid` char(20) DEFAULT NULL COMMENT '关联分类表 顶级分类',
  `category_uuid` char(20) DEFAULT NULL COMMENT '关联分类表 当前分类',
  `measurement` varchar(10) DEFAULT NULL COMMENT '计量单位',
  `price` decimal(21,6) DEFAULT NULL COMMENT '价格',
  `is_stock` int(11) DEFAULT NULL COMMENT '库存',
  `supplier_address` longtext COMMENT '供应商地址',
  `component` varchar(200) DEFAULT NULL COMMENT '成分',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_index` (`uuid`),
  UNIQUE KEY `unique_name` (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='缝纫线资源表';

