/*Table structure for table `season_category` */

DROP TABLE IF EXISTS `season_category`;

CREATE TABLE `season_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '表主键',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `modify_date` datetime NOT NULL COMMENT '最后修改时间',
  `version` int(11) NOT NULL COMMENT '版本号',
  `creator` varchar(25) CHARACTER SET utf8mb4 NOT NULL COMMENT '创建人',
  `modifier` varchar(25) CHARACTER SET utf8mb4 NOT NULL COMMENT '修改人',
  `uuid` char(20) NOT NULL COMMENT '业务主键',
  `parent_id` char(20) NOT NULL COMMENT '上级节点主键',
  `class_name` varchar(25) CHARACTER SET utf8mb4 NOT NULL COMMENT '分类名称',
  `status` bit(1) NOT NULL COMMENT '状态位：0隐藏1显示',
  `description` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '描述',
  `del_flag` bit(1) NOT NULL COMMENT '删除标识：1正常0删除',
  `orders` int(11) DEFAULT NULL COMMENT '排序',
  `grade` int(11) NOT NULL COMMENT '层级',
  `tree_path` varchar(255) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '节点路径',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_index` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='季节分类';

